import c from './AllPosts.module.css';
import Post from './post/Post';
import React from 'react';

const AllPosts = (props) => {

    let allPostsData = [
        {id:1, username: "Pavel", title: "Заголовок 1", text: "Текст", likes: 12, dislikes: 3},
        {id:1, username: "Petr", title: "Заголовок 2", text: "Текст", likes: 16, dislikes: 5},
        {id:1, username: "Dima", title: "Заголовок 3", text: "Текст", likes: 21, dislikes: 8},
        {id:1, username: "Anton", title: "Заголовок 4", text: "Текст", likes: 16, dislikes: 2},
    ]

    return(
        <div className={c.AllPosts}>
            <Post username={allPostsData[0].username} title={allPostsData[0].title} text={allPostsData[0].text} likes={allPostsData[0].likes} dislikes={allPostsData[0].dislikes}/>
            <Post username={allPostsData[1].username} title={allPostsData[1].title} text={allPostsData[1].text} likes={allPostsData[1].likes} dislikes={allPostsData[1].dislikes}/>
            <Post username={allPostsData[2].username} title={allPostsData[2].title} text={allPostsData[2].text} likes={allPostsData[2].likes} dislikes={allPostsData[2].dislikes}/>
            <Post username={allPostsData[3].username} title={allPostsData[3].title} text={allPostsData[3].text} likes={allPostsData[3].likes} dislikes={allPostsData[3].dislikes}/>
        </div>
    );
}

export default AllPosts;
